import { Button } from "@material-ui/core";
import React from "react";

const Accordion = (props) => {
    return (
        <>
            <div>
                <Button/>
                <h2>{props.questions} </h2>
            </div>
            <p>{props.answers}</p>
        </>
    );
};

export default Accordion;
